Billie Holiday (born Eleanora Fagan; April 7, 1915 ? July 17, 1959) was an American jazz singer and songwriter.

Nicknamed Lady Day by her sometime collaborator Lester Young, Holiday was a seminal influence on jazz, and pop singing. Her vocal style ? strongly inspired by instrumentalists ? pioneered a new way of manipulating wording and tempo, and also popularized a more personal and intimate approach to singing. Critic John Bush wrote that she &quot;changed the art of American pop vocals forever.&quot; She co-wrote only a few songs, but several of them have become jazz standards, notably &quot;God Bless the Child,&quot; &quot;Don&amp;#039;t Explain,&quot; and &quot;Lady Sings the Blues.&quot;
